import PolyLine from "./PolyLine";

export default function line1() {
  return (
    <g
      name="Line 1"
      className={activeLayer === 1 || activeLayer === 4 ? "" : "hidden"}
    >
      <PolyLine
        type="Medium"
        style={{ transform: "translate(625px, 425px) rotate(90deg)" }}
        // onClick={() => onUpdate("02345")}
        name="02345"
      />
      <PolyLine
        type="Portec"
        style={{
          transform: "translate(625px,590px) rotate(270deg)",
          strokeLinejoin: "bevel",
        }}
      />
      <PolyLine type="Long" style={{ transform: "translate(1250px, 590px" }} />
      <PolyLine type="Long" style={{ transform: "translate(945px,590px)" }} />
      <PolyLine type="Long" style={{ transform: "translate(640px,590px)" }} />

      {/* AutoSAL 1 */}
      <PolyLine
        type="Portec"
        style={{
          transform: "translate(1565px,590px) rotate(90deg)",
          strokeLinejoin: "bevel",
        }}
      />
      <PolyLine
        type="Short"
        style={{ transform: "translate(1565px, 605px) rotate(90deg)" }}
      />
      <PolyLine
        type="Portec"
        style={{
          transform: "translate(1565px,645px) rotate(180deg)",
          strokeLinejoin: "bevel",
        }}
      />
      <PolyLine type="Long" style={{ transform: "translate(1250px,645px)" }} />
      {/* BEGIN SEGMENTS */}

      {/* Loops in order to get rid of repetitive code.  */}
      {Array.from({ length: 15 }, (_, index) => (
        <PolyLine
          key={index}
          type="Segmented"
          style={{ transform: `translate(${1235 - index * 15}px, 645px)` }}
        />
      ))}
    </g>
  );
}
